import React, { useEffect } from 'react'
import axios from 'axios'


const Administration = () => {

    useEffect(() => {
        const getUsers = async () => {
            try {
                const { data } = await axios.get("http://localhost:4000/admin")
                console.log(data);
            } catch (err) {
                console.err(err);
            }
        }
        getUsers();
    }, [])

    return (
        <div>Administration</div>
    )
}

export default Administration
